Broken Britain may be staring into the bottom of an
empty pint glass, but don't lose hope - Al Murray The
Pub Landlord is back to fill it up again, with a brand
new stand-up show of epic proportions.

Britain's most irrepressible Innkeeper will be serving
up his premier brew of ale-inspired acumen and bar-room
buffoonery on this latest live DVD, recorded as part of
his 2012 The Only Way Is Epic tour.

This monumental new show from the multi-award-winning
comedian directly follows the nationwide success of the
Guv's twice extended Barrel of Fun tour.
